                <p>Not totally happy with your order? Enter your order number in the form below to initiat the return process.</p>
                    <form>
                        <input type="text" />
                        <button href="/">Track</button>
                    </form>
                </div>
            </div>
        );
    }
}

export default ReturnsExchanges;
